classdef LTPlanner < handle
    %LTPLANNER Summary of this class goes here
    %   Detailed explanation goes here
    
    properties
        % Degrees of freedom of the robot
        DoF;

        % Sample time
        Tsample;

        %Output length in samples
        num_samples = 10000;
        
        % Maximal jerk, acceleration and velocity for every joint
        j_max;
        a_max;
        v_max;
    end
    
    methods
        function obj = LTPlanner(varargin)
            %LTPLANNER Construct an instance of this class
            if nargin>2
                obj.v_max = varargin{3};
                obj.a_max = varargin{4};
                obj.j_max = varargin{5};
            end
            obj.DoF = varargin{1};
            obj.Tsample = varargin{2};
        end
        
        function obj = setLimits(obj, v_max, a_max, j_max)
            %SETLIMITS Change maximal jerk, acceleration and velocity for
            %every joint
            obj.j_max = j_max;
            obj.a_max = a_max;
            obj.v_max = v_max;
        end
        
        function checkInputs(obj, v_0, a_0)
            for i=1:obj.DoF
                % Check input velocity and acceleration
                if(abs(v_0(i)) > obj.v_max(i))
                    error("Input velocity exceeds limits.")
                end
                if(abs(a_0(i)) > obj.a_max(i))
                    error("Input acceleration exceeds limits.")
                end
                if (abs(v_0(i) + 1/2*a_0(i)*abs(a_0(i))/obj.j_max(i)) > obj.v_max(i))
                    error("Input velocity will exceed limits because acceleration is too high.")
                end
            end
        end
        
        function t = optSwitchTimes(obj, q_goal, q_0, v_0, a_0)
            %OPTSWITCHTIMES Calculate time-optimal jerk swtiches

            % Set number of iteration cycles for numerc approximation
            % (only in case v_max is not reach)
            v_max_reduction_cycles = 30;
            v_max_reduced = obj.v_max*ones(obj.DoF);
            
            % Parameters for calculation
            dir = zeros(obj.DoF,1); % Direction of the goal (only +1 or -1)
            t_rel = zeros(obj.DoF,7); % Time that is required for one jerk phase
            t_rel_prev = zeros(1,7);
            t = zeros(obj.DoF,7); % Absolute time that is required to reach the end of current jerk phase
            eps = 1e-6;

            %% Analyse input data
            % Check if inputs are in limits
            checkInputs(obj, v_0, a_0);
            
            for i=1:obj.DoF
                
                % Calculate direction of movement
                [q_stop, t_rel_prev(i, 1:3)] = getStopPos(obj, v_0, a_0, i);
                q_diff = q_goal(i) - (q_0(i) + q_stop);
                if (abs(q_diff) < eps)
                    % Skip rest if that fulfils scenario
                    t_rel(i,:) = t_rel_prev;
                    continue;
                end
                dir(i) = sign(q_diff);

                % If goal is in negative direction, map to pos. direction
                if(dir(i) < 0)
                    v_0(i) = -v_0(i);
                    a_0(i) = -a_0(i);
                end

                %% Calculate min. time required per joint to reach goal state

                % Reduction loop of v_max (if necessary)
                v_max_reduction_loop_no = 0;
                while(v_max_reduction_loop_no < v_max_reduction_cycles)

                    % j = +- j_max (const) -> linear a
                    t_rel(i,1) = (obj.a_max(i) - a_0(i))/obj.j_max(i);
                    t_rel(i,3) = obj.a_max(i)/obj.j_max(i);
                    t_rel(i,5) = t_rel(i,3);
                    t_rel(i,7) = t_rel(i,3);

                    % a = +- a_max (const) -> linear v
                    % works but only if all times > 0
                    t_rel(i,2) = (v_max_reduced(i) - v_0(i) - 1/2*t_rel(i,1)*a_0(i))/obj.a_max(i) - 1/2*(t_rel(i,1) + t_rel(i,3));
                    t_rel(i,6) = v_max_reduced(i)/obj.a_max(i) - 1/2*(t_rel(i,5) + t_rel(i,7));

                    % Check if max acceleration cannot be reached
                    if(t_rel(i,2) < -obj.Tsample)
                        % Check if root is positive
                        root = obj.j_max(i)*(v_max_reduced(i) - v_0(i)) + 1/2*a_0(i)^2;
                        if(root > 0)
                            t_rel(i,3) = sqrt(root)/obj.j_max(i);
                            t_rel(i,1) = t_rel(i,3) - a_0(i)/obj.j_max(i);
                            t_rel(i,2) = 0;
                            
                            if (t_rel(i,1) < -obj.Tsample)
                                if v_max_reduction_loop_no == 0
                                    error("t_rel(" + i + ",1) is negative: " + t_rel(i,1))
                                else
                                    % Approximate v_max (increase)
                                    v_max_reduction_loop_no = v_max_reduction_loop_no + 1;
                                    v_max_reduced(i) = v_max_reduced(i) + obj.v_max(i) * (1/2)^v_max_reduction_loop_no;
                                    
                                    % Assign t_rel from last valid loop
                                    t_rel(i,:) = t_rel_prev;
                                    continue;
                                end
                            end
                        else
                            if v_max_reduction_loop_no == 0
                                error("Negative root in t_rel(" + i + ",2): " + root)
                            else
                                % Approximate v_max (increase)
                                v_max_reduction_loop_no = v_max_reduction_loop_no + 1;
                                v_max_reduced(i) = v_max_reduced(i) + obj.v_max(i) * (1/2)^v_max_reduction_loop_no;
                                
                                % Assign t_rel from last valid loop
                                t_rel(i,:) = t_rel_prev;
                                continue;
                            end
                        end
                    end
                    
                    if(t_rel(i,6) < -obj.Tsample)
                        % Check if root is positive
                        root = v_max_reduced(i)/obj.j_max(i);
                        if(root > 0)
                            t_rel(i,5) = sqrt(root);
                            t_rel(i,7) = t_rel(i,5);
                            t_rel(i,6) = 0;
                        else
                            if v_max_reduction_loop_no == 0
                                error("Negative root in t_rel(" + i + ",6): " + root)
                            else
                                % Approximate v_max (increase)
                                v_max_reduction_loop_no = v_max_reduction_loop_no + 1;
                                v_max_reduced(i) = v_max_reduced(i) + obj.v_max(i) * (1/2)^v_max_reduction_loop_no;
                                
                                % Assign t_rel from last valid loop
                                t_rel(i,:) = t_rel_prev;
                                continue;
                            end
                        end
                    end

                    % v = v_max (const) -> linear q
                    q_part1 = v_0(i)*(t_rel(i,1) + t_rel(i,2) + t_rel(i,3)) + a_0(i)*(1/2*t_rel(i,1)^2 + t_rel(i,1)*(t_rel(i,2) + t_rel(i,3)) + 1/2*t_rel(i,3)^2) + obj.j_max(i)*(1/6*t_rel(i,1)^3 + 1/2*t_rel(i,1)^2*(t_rel(i,2) + t_rel(i,3)) - 1/6*t_rel(i,3)^3 + 1/2*t_rel(i,1)*t_rel(i,3)^2) + obj.a_max(i)*(1/2*t_rel(i,2)^2 + t_rel(i,2)*t_rel(i,3));
                    q_part2 = obj.j_max(i)*(1/6*t_rel(i,7)^3 + 1/2*t_rel(i,7)^2*(t_rel(i,6) + t_rel(i,5)) - 1/6*t_rel(i,5)^3 + 1/2*t_rel(i,7)*t_rel(i,5)^2) + obj.a_max(i)*(1/2*t_rel(i,6)^2 + t_rel(i,6)*t_rel(i,5));
                    t_rel(i,4) = ((q_goal(i) - q_0(i))*dir - q_part1 - q_part2)/v_max_reduced(i);

                    % Check if max velocity cannot be reached
                    if(t_rel(i,4) < -obj.Tsample)
                        % Formula calculated with matlab
                        % Check if root is positive
                        root = (obj.j_max(i)^2*t_rel(i,1)^4)/2 - (obj.j_max(i)^2*t_rel(i,3)^4)/4 + (obj.j_max(i)^2*t_rel(i,3)^2*t_rel(i,5)^2)/2 - (obj.j_max(i)^2*t_rel(i,5)^4)/4 + (obj.j_max(i)^2*t_rel(i,7)^4)/2 + 2*obj.j_max(i)*a_0(i)*t_rel(i,1)^3 - (2*obj.j_max(i)*obj.a_max(i)*t_rel(i,1)^3)/3 - 2*obj.j_max(i)*obj.a_max(i)*t_rel(i,1)*t_rel(i,3)^2 + (2*obj.j_max(i)*obj.a_max(i)*t_rel(i,3)^3)/3 + (2*obj.j_max(i)*obj.a_max(i)*t_rel(i,5)^3)/3 - 2*obj.j_max(i)*obj.a_max(i)*t_rel(i,5)^2*t_rel(i,7) - (2*obj.j_max(i)*obj.a_max(i)*t_rel(i,7)^3)/3 + 2*obj.j_max(i)*v_0(i)*t_rel(i,1)^2 + 2*a_0(i)^2*t_rel(i,1)^2 - 2*a_0(i)*obj.a_max(i)*t_rel(i,1)^2 - 2*a_0(i)*obj.a_max(i)*t_rel(i,3)^2 + 4*a_0(i)*v_0(i)*t_rel(i,1) + 2*obj.a_max(i)^2*t_rel(i,3)^2 + 2*obj.a_max(i)^2*t_rel(i,5)^2 - 4*obj.a_max(i)*v_0(i)*t_rel(i,1) + 4*dir*(q_goal(i) - q_0(i))*obj.a_max(i) + 2*v_0(i)^2;
                        if(0 < root)
                            t_rel(i,6) = -(4*obj.a_max(i)*t_rel(i,5) - 2*root^(1/2) + obj.j_max(i)*t_rel(i,3)^2 - obj.j_max(i)*t_rel(i,5)^2 + 2*obj.j_max(i)*t_rel(i,7)^2)/(4*obj.a_max(i));
                            t_rel(i,2) = (-v_0(i) - a_0(i)*t_rel(i,1) - 1/2*obj.j_max(i)*t_rel(i,1)^2 + 1/2*obj.j_max(i)*t_rel(i,3)^2 + 1/2*obj.j_max(i)*t_rel(i,7)^2 - 1/2*obj.j_max(i)*t_rel(i,5)^2)/obj.a_max(i) - t_rel(i,3) + t_rel(i,6) + t_rel(i,5);
                            t_rel(i,4) = 0;
                        else
                            % Approximate v_max (increase)
                            v_max_reduction_loop_no = v_max_reduction_loop_no + 1;
                            v_max_reduced(i) = v_max_reduced(i) + obj.v_max(i) * (1/2)^v_max_reduction_loop_no;
                            
                            % Assign t_rel from last valid loop
                            t_rel(i,:) = t_rel_prev;
                            continue;
                        end
                        
                        % Check if max velocity and max acceleration cannot be reached
                        if(t_rel(i,6) < -obj.Tsample || t_rel(i,2) < -obj.Tsample)
                            t_rel(i,1) = (2*(sqrt((4*a_0(i)^2)/3 - (8*v_0(i)*obj.j_max(i))/3 + (216*dir(i)^2*obj.j_max(i)^4*q_0(i)^2 - 432*dir(i)^2*obj.j_max(i)^4*q_0(i)*q_goal(i) + 216*dir(i)^2*obj.j_max(i)^4*q_goal(i)^2 + 144*a_0(i)^3*dir(i)*obj.j_max(i)^2*q_0(i) - 144*a_0(i)^3*dir(i)*obj.j_max(i)^2*q_goal(i) - 432*a_0(i)*dir(i)*obj.j_max(i)^3*q_0(i)*v_0(i) + 432*a_0(i)*dir(i)*obj.j_max(i)^3*q_goal(i)*v_0(i) - 2*a_0(i)^6 + 12*a_0(i)^4*obj.j_max(i)*v_0(i) - 96*a_0(i)^2*obj.j_max(i)^2*v_0(i)^2 + 208*obj.j_max(i)^3*v_0(i)^3 + sqrt(46656*dir(i)^4*obj.j_max(i)^8*q_0(i)^4 - 186624*dir(i)^4*obj.j_max(i)^8*q_0(i)^3*q_goal(i) + 279936*dir(i)^4*obj.j_max(i)^8*q_0(i)^2*q_goal(i)^2 - 186624*dir(i)^4*obj.j_max(i)^8*q_0(i)*q_goal(i)^3 + 46656*dir(i)^4*obj.j_max(i)^8*q_goal(i)^4 + 62208*a_0(i)^3*dir(i)^3*obj.j_max(i)^6*q_0(i)^3 - 186624*a_0(i)^3*dir(i)^3*obj.j_max(i)^6*q_0(i)^2*q_goal(i) + 186624*a_0(i)^3*dir(i)^3*obj.j_max(i)^6*q_0(i)*q_goal(i)^2 - 62208*a_0(i)^3*dir(i)^3*obj.j_max(i)^6*q_goal(i)^3 - 186624*a_0(i)*dir(i)^3*obj.j_max(i)^7*q_0(i)^3*v_0(i) + 559872*a_0(i)*dir(i)^3*obj.j_max(i)^7*q_0(i)^2*q_goal(i)*v_0(i) - 559872*a_0(i)*dir(i)^3*obj.j_max(i)^7*q_0(i)*q_goal(i)^2*v_0(i) + 186624*a_0(i)*dir(i)^3*obj.j_max(i)^7*q_goal(i)^3*v_0(i) + 19872*a_0(i)^6*dir(i)^2*obj.j_max(i)^4*q_0(i)^2 - 39744*a_0(i)^6*dir(i)^2*obj.j_max(i)^4*q_0(i)*q_goal(i) + 19872*a_0(i)^6*dir(i)^2*obj.j_max(i)^4*q_goal(i)^2 - 119232*a_0(i)^4*dir(i)^2*obj.j_max(i)^5*q_0(i)^2*v_0(i) + 238464*a_0(i)^4*dir(i)^2*obj.j_max(i)^5*q_0(i)*q_goal(i)*v_0(i) - 119232*a_0(i)^4*dir(i)^2*obj.j_max(i)^5*q_goal(i)^2*v_0(i) + 145152*a_0(i)^2*dir(i)^2*obj.j_max(i)^6*q_0(i)^2*v_0(i)^2 - 290304*a_0(i)^2*dir(i)^2*obj.j_max(i)^6*q_0(i)*q_goal(i)*v_0(i)^2 + 145152*a_0(i)^2*dir(i)^2*obj.j_max(i)^6*q_goal(i)^2*v_0(i)^2 + 89856*dir(i)^2*obj.j_max(i)^7*q_0(i)^2*v_0(i)^3 - 179712*dir(i)^2*obj.j_max(i)^7*q_0(i)*q_goal(i)*v_0(i)^3 + 89856*dir(i)^2*obj.j_max(i)^7*q_goal(i)^2*v_0(i)^3 - 576*a_0(i)^9*dir(i)*obj.j_max(i)^2*q_0(i) + 576*a_